import React, { useEffect } from 'react'
import { AppContext } from '../context/context'

const Home = ({ history }) => {
  const { loginUser } = React.useContext(AppContext)
  console.log(loginUser)

  useEffect(() => {
    if (!loginUser.name) {
      history.push('/')
    }
  }, [history])

  return (
    <div>
      <h1>Home</h1>
    </div>
  )
}

export default Home
